event:
  concept:instance: 5777
  concept:name: Fetch Program
  concept:endpoint: https://centurio.work/artefacts/etm/IRB2600/raw/master/Measure_Turm/move_Portal_to_Tray.mod
  id:id: a4
  cpee:activity: a4
  cpee:activity_uuid: afc8554db329c2882979acb953aaa1aa
  cpee:instance: f060e3e1-db91-4092-ba70-8fe53b25d146
  lifecycle:transition: unknown
  cpee:lifecycle:transition: activity/receiving
  raw:
  - name: result
    mimetype: text/plain
    data: |
      MODULE OperationModule
          CONST robtarget PortalHighPoint:=[[-13.583341243,746.066869797,1014.459993125],[0.013993802,-0.570055065,0.820624094,0.037649604],[1,0,0,0],[9E+09,9E+09,9E+09,9E+09,9E+09,9E+09]];
          CONST robtarget PortalEntry:=[[-434.055731075,387.84090848,937.564082687],[0.00129595,0.766122039,-0.642494033,-0.016023701],[1,0,0,0],[9E+09,9E+09,9E+09,9E+09,9E+09,9E+09]];
          CONST robtarget PortalHoverPoint:=[[-631.245040038,556.972820959,570.118199049],[0.00217368,0.825005825,-0.56505388,-0.008647398],[1,0,0,0],[9E+09,9E+09,9E+09,9E+09,9E+09,9E+09]];
          CONST robtarget HoverPointinwobjPalette:=[[135.37,228.21,-234.18],[0.814711508,0.002312507,0.003108067,-0.57985356],[1,0,0,0],[9E+09,9E+09,9E+09,9E+09,9E+09,9E+09]];

          VAR intnum xpos:=%%x;
          VAR intnum ypos:=%%y;
          VAR intnum zpos:=%%z;

          PROC Operation()
              !*******************************
              ! Ablage (oder Aufnahme) des GV12 auf (von) der Palette.
              !*******************************
              MoveL PortalHighPoint,jFast,z50,tool_Parallelgreifer_Standard\WObj:=wobj0;
              MoveL PortalEntry,jFast,z50,tool_Parallelgreifer_Standard\WObj:=wobj0;
              MoveL PortalHoverPoint,jFast,z50,tool_Parallelgreifer_Standard\WObj:=wobj0;
              MoveL HoverPointinwobjPalette,jFast,z50,tool_Parallelgreifer_Standard\WObj:=wobj_Palette;

              MoveL Offs(HoverPointinwobjPalette,xpos,ypos,zpos-80),jMedium,fine,tool_Parallelgreifer_Standard\WObj:=wobj_Palette;
              MoveL Offs(HoverPointinwobjPalette,xpos,ypos,zpos),jSlow,fine,tool_Parallelgreifer_Standard\WObj:=wobj_Palette;
              %%gGripper;
              MoveL Offs(HoverPointinwobjPalette,xpos,ypos,zpos-80),jSlow,fine,tool_Parallelgreifer_Standard\WObj:=wobj_Palette;

              MoveL HoverPointinwobjPalette,jMedium,z50,tool_Parallelgreifer_Standard\WObj:=wobj_Palette;
              MoveL PortalHoverPoint,jMedium,z50,tool_Parallelgreifer_Standard\WObj:=wobj0;
              MoveL PortalEntry,jFast,z50,tool_Parallelgreifer_Standard\WObj:=wobj0;
              MoveL PortalHighPoint,jFast,z50,tool_Parallelgreifer_Standard\WObj:=wobj0;
          ENDPROC
      ENDMODULE
  time:timestamp: '2023-04-28T17:34:19.131+02:00'
